import React from 'react';

const ReferenceItem = ({name, phone, email, relation}) => {
  return (
    <React.Fragment>
      <span className='referencename'>{name}</span>
      <span className='referencerelation'>{relation}</span>
      <span className='referencephone'>{phone}</span>
      <span className='referenceemail'>{email}</span>
    </React.Fragment>
  );
}

export default ReferenceItem;
